import React from 'react';
import Matrix from './Matrix'; 
import VideoJS from './VideoJS';
import Video from './Video';// Replace with the correct path to your VideoPlayer component

function Live() {
  return (
    <div className="App">
      <Matrix/>
      <VideoJS/>
      <Video/>
    </div>
  );
}

export default Live;
